import Books from "./Books";
import { Container } from "@material-ui/core";
import Movies from "./Movies";

function App() {
  return (
    <div className="App">
      <Container>
        <Books/>
        <br/><br/>
        <Movies/>
      </Container>
    </div>
  );
}

export default App;
